import React, { useState } from "react";
import portrait from "../imgs/default-pp.jpg";
import "../Dashboard.css";

export default function Dashboard() {
  const [containerMiddleContent, setContainerContent] = useState(null);
  const [hoveredContainer, setHoveredContainer] = useState(null);

  const generateInvestCode = () => {
    return <div></div>;
  };

  const handleTextClick = (content) => {
    setHoveredContainer(null); // Reset hovered container when a new container is clicked
    switch (content) {
      case "dashboard":
        setContainerContent(null);
        break;
      case "invest":
        setContainerContent(generateInvestCode());
        break;
      case "following-assets":
        setContainerContent(<h4>Following-list1</h4>);
        break;
      case "portfolios":
        setContainerContent(<h4>Portfolios1</h4>);
        break;
      case "profile":
        setContainerContent(<h4>Profile1</h4>);
        break;
      case "log-out":
        setContainerContent(<h4>Log-out1</h4>);
        break;
      default:
        setContainerContent(null);
        break;
    }
  };

  const handleContainerHover = (container) => {
    setHoveredContainer(container);
  };

  return (
    <div className="dashboard">
      <h2 className="page-title">Placeholder</h2>
      <div className="container-middle">{containerMiddleContent}</div>
      <div className="profile">
        <h4 className="name">Alexandru Culea</h4>
        <img src={portrait} alt=" "></img>
      </div>
      <div className="containers-left">
        <div className="first-container">
          <h3
            className="first-container-text"
            onClick={() => handleTextClick("dashboard")}
            onMouseEnter={() => handleContainerHover("dashboard")}
            onMouseLeave={() => handleContainerHover(null)}
            style={{
              backgroundColor:
                hoveredContainer === "dashboard" ? "rgb(161, 161, 161)" : "",
            }}
          >
            Dashboard
          </h3>
        </div>
        <div className="second-container">
          <h4
            className="second-container-text"
            onClick={() => handleTextClick("invest")}
            onMouseEnter={() => handleContainerHover("invest")}
            onMouseLeave={() => handleContainerHover(null)}
            style={{
              backgroundColor:
                hoveredContainer === "invest" ? "rgb(161, 161, 161)" : "",
            }}
          >
            Invest
          </h4>
          <h4
            className="second-container-text"
            onClick={() => handleTextClick("following-assets")}
            onMouseEnter={() => handleContainerHover("following-assets")}
            onMouseLeave={() => handleContainerHover(null)}
            style={{
              backgroundColor:
                hoveredContainer === "following-assets"
                  ? "rgb(161, 161, 161)"
                  : "",
            }}
          >
            Followed Assets
          </h4>
          <h4
            className="second-container-text"
            onClick={() => handleTextClick("portfolios")}
            onMouseEnter={() => handleContainerHover("portfolios")}
            onMouseLeave={() => handleContainerHover(null)}
            style={{
              backgroundColor:
                hoveredContainer === "portfolios" ? "rgb(161, 161, 161)" : "",
            }}
          >
            Porfolios
          </h4>
        </div>
        <div className="third-container">
          <h4
            className="third-container-text"
            onClick={() => handleTextClick("profile")}
            onMouseEnter={() => handleContainerHover("profile")}
            onMouseLeave={() => handleContainerHover(null)}
            style={{
              backgroundColor:
                hoveredContainer === "profile" ? "rgb(161, 161, 161)" : "",
            }}
          >
            Profile
          </h4>
          <h4
            className="third-container-text"
            onClick={() => handleTextClick("log-out")}
            onMouseEnter={() => handleContainerHover("log-out")}
            onMouseLeave={() => handleContainerHover(null)}
            style={{
              backgroundColor:
                hoveredContainer === "log-out" ? "rgb(161, 161, 161)" : "",
            }}
          >
            Log out
          </h4>
        </div>
      </div>
    </div>
  );
}
